import AllMeetups from './pages/AllMeetups'
import Favorites from './pages/Favorites'
import NewMeetup from './pages/NewMeetup'

function App() {
  return (
   <div>
     <Route path='/'>
       <AllMeetups></AllMeetups>
      </Route>
      <Route path='/new-meetup'>
       <NewMeetup></NewMeetup>
       <Route path='/favorites'>
       <Favorites></Favorites>
      </Route>
      </Route>
   </div>
  );
}

export default App;
